import React from 'react';

const MenuItem = ({ title, imageUrl, id, size }) => (
    <div className={`menu-item ${size}`}>
        <div
            style={`background:${imageUrl}`}
            className="content">
            <h1 className="title">{title}</h1>
            <span className="subtitle">BUY NOW</span>
        </div>
    </div>
)

export default MenuItem
